  "Firm Name" : "DEAN WITTER REYNOLDS INC.",
  "Termination Type" : "Discharged",
  "Broker Comment" : "(OTHER RELATED ITEMS, 22F4 AND 22N1): U4 RECEIVED FROM THE CHICAGO CORPORATION DISCLOSES THAT WOOD WAS DISCHARGED FROM DEAN WITTER REYNOLDS INC. AND WAS THE SUBJECT OF A DISCIPLINARY PROCEEDING BEFORE THE CHICAGO BOARD OPTIONS EXCHANGE, INC. (\"In the Matter of: DOUGLAS D. WOOD, Respondent,\" FILE NO. 86-0102). ON DECEMBER 30, 1986, THE CBOE ACCEPTED WOOD'S OFFER OF SETTLEMENT BASED UPON ITS FINDING OF THE FOLLOWING FACTS: DURING ALL RELEVANT PERIODS, WOOD WAS REGISTERED WITH THE EXCHANGE AS A REPRESENTATIVE OF DEAN WITTER; ON OR ABOUT DECEMBER 18, 1985, WOOD EFFECTED THE PURCHASE OF TWELVE CONTRACTS IN THE STANDARD & POOR'S 100 STOCK INDEX (OEX) FEB 195 CALL OPTION SERIES FOR A PUBLIC CUSTOMER WITHOUT THAT CUSTOMER'S AUTHORIZATION. THE CBOE CONCLUDED THAT THIS CONSTITUTES VIOLATIONS OF EXCHANGE RULES 4.1. AND 9.10(a) BY WOOD AND ORDERED THAT HE BE SUSPENDED FOR TWO CONSECUTIVE WEEKS. (A COPY OF THE CBOE DECISION WAS RECEIVED.)"
}

